(1, '\'Roboto Condensed\', sans-serif', '#f7f7f7', '#ffffff', '#ffffff', '#ffffff', '#ffffff', '#D8C53F', '#D8C53F', '#D8C53F', '#', '#', '#D8C53F', '#D8C53F', '#D5B722', '#D5B722', '#D5B722', '#D5B722', '#D5B722', '#D5B722', '1.3125rem', '2024-01-01 17:36:03', '2025-08-05 17:11:41', '', '', '', '', '', '', '#DBCE6E', '#D3AD06', '#D5B722', '#D5B722', '#DBCE6E', '#D5B722', '#3E95FE', '#F45C4E', '#ca50f3', '#fbaf01', '/profile/linkconvite', '/profile/promocoes', '/profile/messages', '/profile/promocoes?tab=vip', '', '#D8C53F', '#ffffff', '#D3AD06', '#ffffff', '#F3F2F5', '<p>1. Introduction</p><p><br></p><p>1.1. Ao usar, visitar e/ou acessar qualquer parte da AGLOW e/ou qualquer subdomínio, site ou aplicativo móvel que possuímos ou operamos (o “Website”) e/ou registrar uma conta no Website, você concorda em estar vinculado a estes Termos e Condições, nossa Política de Privacidade, nossa Política de Cookies e quaisquer outras regras aplicáveis aos nossos produtos de apostas ou jogos disponíveis no Website (juntos, os \"Termos\"), e é considerado como tendo aceitado e entendido todos os Termos.</p><p><br></p><p>1.2. Você deve ler os Termos com atenção. Se não concordar com eles e/ou não puder aceitá-los, não use, visite ou acesse o Website.</p><p><br></p><p>1.3. Estes Termos podem ser alterados por nós de tempos em tempos por qualquer motivo (incluindo conformidade com a legislação aplicável ou requisitos dos reguladores). A versão atual dos Termos estará disponível no Website. Se você continuar a usar o Website após essas alterações entrarem em vigor, você será considerado como tendo aceitado tais alterações aos Termos.</p><p><br></p><p>1.4. A AGLOW é operado pela AGLOW777 N.V., uma empresa registrada sob as leis de Curaçau sob o número de registro 137692.</p><p><br></p><p>1.5. A referência a “você”, “seu”, “cliente”, “usuário” ou “jogador” significa qualquer pessoa que use o Website ou quaisquer serviços disponíveis nele e/ou qualquer cliente registrado do Website.</p><p><br></p><p>1.6. A referência a “jogos” significa Cassino, Cassino ao Vivo, Apostas Esportivas, cartas e outros jogos que possam, de tempos em tempos, tornar-se disponíveis no Website. A AGLOW777 N.V. reserva-se o direito de adicionar e remover Jogos do Website a seu critério.</p><p><br></p><p>2. Sua Conta</p><p><br></p><p>2.1. Requisitos legais</p><p><br></p><p>2.1.1. A referência à “Conta” significa uma conta registrada por você no Website após aceitar e concordar com estes Termos. Ao registrar uma Conta, você declara que tem mais de 18 anos de idade ou a maioridade legal mínima mais alta conforme estipulado na jurisdição de sua residência sob as leis aplicáveis a você. É sua responsabilidade saber se os serviços disponíveis no Website são legais no país de sua residência. Pessoas com menos de 18 anos não estão autorizadas a usar o Website e/ou quaisquer serviços disponíveis nele.</p><p><br></p><p>2.1.2. Você não está autorizado a registrar no Website e usar nossos serviços se for residente de Aruba, Austrália, Bonaire, Curaçau, França, Irã, Iraque, Países Baixos, Saba, Espanha, St Maarten, Statia, EUA ou dependências dos EUA, Reino Unido. Reservamo-nos o direito de recusar clientes de quaisquer outros países além das jurisdições acima mencionadas a nosso critério.</p><p><br></p><p>2.2. Registro de Conta</p><p><br></p><p>2.2.1. Para fazer apostas, jogar jogos e depositar dinheiro, você precisa registrar a Conta no Website.</p><p><br></p><p>2.2.2. Para registrar a Conta, você deve fornecer informações completas e atualizadas, incluindo um número de telefone móvel, endereço de e-mail, nome de usuário, senha e outras informações obrigatórias solicitadas no formulário de registro.</p><p><br></p><p>2.2.3. Ao registrar a Conta no Website, você concorda em especificar seu nome legal. Podemos tomar medidas para verificar a precisão das informações que você fornece. Você não está autorizado a alterar esses dados, mas há casos em que você pode solicitar individualmente a alteração de dados entrando em contato com o suporte ao cliente do Website, como em caso de erro honesto, etc.</p><p><br></p><p>2.2.4. Se você escolher, ou se for fornecido com um nome de usuário, senha ou qualquer outra informação como parte de nossos procedimentos de segurança, você deve tratar essas informações como confidenciais e não deve divulgá-las a terceiros. Não somos responsáveis por qualquer abuso ou uso indevido de sua Conta por terceiros devido à sua divulgação, seja intencional ou acidental, ativa ou passiva, dos detalhes de login a terceiros. Nunca solicitaremos que você revele sua senha e nunca iniciaremos contato com você para pedir os memorizadores associados à sua senha.</p><p><br></p><p>2.2.5. Funcionários, ex-funcionários de prestadores de serviços e/ou pessoas afiliadas não estão autorizados a registrar contas no Website e não podem explorar os serviços e promoções disponíveis nele. As mesmas regras se aplicam aos membros da família dos acima mencionados. A violação desta regra resultará no fechamento permanente da conta e as contas referidas serão consideradas fraudulentas. Qualquer ganho derivado de tais atividades será considerado como perdido pelo titular da conta e apenas o valor depositado será devolvido ao titular da conta.</p><p><br></p><p>2.2.6. Você não pode transferir, vender ou penhorar Sua Conta para outra pessoa. Esta proibição inclui a transferência de quaisquer ativos de valor de qualquer tipo, incluindo, mas não se limitando a, propriedade de contas, ganhos, depósitos, apostas, direitos e/ou reivindicações relacionadas a esses ativos, legais, comerciais ou de qualquer outra forma. A proibição de tais transferências também inclui, mas não se limita a, ônus, penhor, cessão, usufruto, comercialização, corretagem, hipoteca e/ou doação em cooperação com um fiduciário ou qualquer outro terceiro, empresa, pessoa natural ou jurídica, fundação e/ou associação de qualquer forma.</p><p><br></p><p>2.3. Problemas com a Conta</p><p><br></p><p>2.3.1. Se você esquecer sua senha ou achar que alguém conhece detalhes de seus dados pessoais, além de suspeitar que outro usuário está se beneficiando injustamente por meio de trapaça ou conluio, você deve relatar a suspeita para nós.</p><p><br></p><p>2.3.2. Reservamo-nos o direito de declarar qualquer aposta ou transação nula total ou parcialmente se, a nosso critério, considerarmos óbvio que qualquer uma das seguintes circunstâncias tenha ocorrido:</p><p><br></p><p>o titular da Conta ou pessoas associadas ao titular da Conta podem influenciar direta ou indiretamente o resultado de um evento;</p><p><br></p><p>o titular da Conta e/ou pessoas associadas ao titular da Conta estão direta ou indiretamente evitando as regras do Website;</p><p><br></p><p>o resultado de um evento ou a aposta foi direta ou indiretamente afetado por atividade criminosa;</p><p><br></p><p>as odds de um evento foram significativamente alteradas devido a um anúncio público relacionado ao evento;</p><p><br></p><p>apostas foram feitas que não teriam sido aceitas de outra forma, mas foram aceitas durante períodos em que o Website foi afetado por problemas técnicos;</p><p><br></p><p>devido a um erro, como um engano, erro de impressão, erro técnico, erro humano, força maior ou outro, apostas foram oferecidas, feitas e/ou aceitas devido a esse erro.</p><p><br></p><p>2.3.3. Quando fecharmos ou suspendermos uma Conta por qualquer motivo, reservamo-nos o direito de fechar quaisquer futuras Contas que possam ser registradas pela mesma pessoa, dispositivo, endereço ou que possam usar as mesmas carteiras de pagamento ou cartões de crédito e anular/cancelar todas as apostas e transações dessas Contas.</p><p><br></p><p>2.3.4. Oferecemos autenticação de dois fatores (2FA) como proteção adicional contra o uso não autorizado de sua Conta. Você é responsável por manter suas informações de login confidenciais e garantir que não possam ser acessadas por outra pessoa.</p><p><br></p><p>2.4. Ao registrar a Conta no Website, você se compromete, declara e garante que:</p><p><br></p><p>2.4.1. Você tem mais de 18 anos ou a maioridade legal mínima estipulada nas leis da jurisdição aplicável a você e, sob as leis aplicáveis a você, é permitido participar dos Jogos oferecidos no Website.</p><p><br></p><p>2.4.2. Você usará este Website e sua Conta única e exclusivamente para a participação genuína nos Jogos e não para quaisquer operações financeiras ou outras; sua participação nos Jogos será estritamente em sua capacidade pessoal não profissional, apenas para fins recreativos e de entretenimento.</p><p><br></p><p>2.4.3. Você participa dos Jogos em seu próprio nome e não em nome de outra pessoa;</p><p><br></p><p>2.4.4. Você não é residente em Curaçau, França, Irã, Iraque, Países Baixos, Coreia do Norte, Singapura, Espanha, St Maarten, Statia, EUA ou dependências dos EUA, Ucrânia, Reino Unido.</p><p><br></p><p>2.4.5. Todas as informações que você fornecer à SLOTAGLOW777 N.V. são verdadeiras, completas e corretas, e que você deverá nos notificar imediatamente sobre qualquer alteração dessas informações.</p><p><br></p><p>2.4.6. Você é o único responsável por relatar e contabilizar quaisquer impostos aplicáveis a você de acordo com as leis relevantes para quaisquer ganhos que você receba da SLOTAGLOW777 N.V.</p><p><br></p><p>2.4.7. Todo o dinheiro que você deposita em sua Conta não está contaminado com qualquer ilegalidade e, em particular, não origina de qualquer atividade ou fonte ilegal.</p><p><br></p><p>2.4.8. Você entende que, ao participar dos Jogos, você assume o risco de perder o dinheiro depositado em sua Conta.</p><p><br></p><p>2.4.9. Você não deve se envolver em qualquer atividade fraudulenta, colusiva, manipulação ou outra atividade ilegal em relação à sua participação ou à participação de terceiros em qualquer um dos Jogos e não deve usar métodos ou técnicas assistidas por software ou dispositivos de hardware para sua participação em qualquer um dos Jogos. A SLOTAGLOW777 N.V. reserva-se o direito de invalidar ou fechar sua Conta ou invalidar sua participação em um Jogo em caso de tal comportamento.</p><p><br></p><p>2.4.10. Em relação a depósitos e retiradas de fundos, você fornecerá um método de pagamento válido e autorizado em seu nome e que não usará qualquer método de pagamento que não seja de sua própria propriedade. A SLOTAGLOW777 N.V. reserva-se o direito de verificar o método de pagamento e/ou o endereço de e-mail fornecido e de exigir documentos para tal verificação. Além disso, a SLOTAGLOW777 N.V. pode solicitar que você forneça uma identificação válida para verificar sua identidade, se necessário, de acordo com as leis aplicáveis à prevenção de crimes financeiros, lavagem de dinheiro e financiamento do terrorismo.</p><p><br></p><p>3. Depósitos e Retiradas</p><p><br></p><p>3.1. Depósitos</p><p><br></p><p>3.1.1. Quando você faz um depósito em sua Conta, você está confirmando que você é o proprietário dos fundos depositados e que os fundos não são de qualquer fonte ilegal.</p><p><br></p><p>3.1.2. O montante mínimo e máximo que pode ser depositado em sua Conta depende da moeda e do método de depósito utilizado. A SLOTAGLOW777 N.V. pode alterar esses limites a qualquer momento e sem aviso prévio. Se você não tiver certeza sobre os limites, por favor, entre em contato com nosso suporte ao cliente.</p><p><br></p><p>3.1.3. Ao fazer um depósito, você deve garantir que o método de pagamento usado está em seu nome. Qualquer depósito feito através de um método de pagamento que não esteja em seu nome pode ser recusado e retornado.</p><p><br></p><p>3.1.4. Todos os depósitos são processados de acordo com nossos procedimentos e podem levar algum tempo para serem creditados na sua Conta.</p><p><br></p><p>3.2. Retiradas</p><p><br></p><p>3.2.1. Para retirar fundos de sua Conta, você deve solicitar uma retirada através da área de gerenciamento de conta no Website.</p><p><br></p><p>3.2.2. O montante mínimo e máximo que pode ser retirado depende da moeda e do método de retirada utilizado. A AGLOW777 N.V. pode alterar esses limites a qualquer momento e sem aviso prévio. Se você não tiver certeza sobre os limites, por favor, entre em contato com nosso suporte ao cliente.</p><p><br></p><p>3.2.3. Todas as retiradas estão sujeitas a verificação de identidade e podem estar sujeitas a verificações adicionais de segurança. A AGLOW777&nbsp; N.V. pode solicitar documentos adicionais para verificar sua identidade e a origem dos fundos.</p><p><br></p><p>3.2.4. A AGLOW777 N.V. reserva-se o direito de cobrar uma taxa de processamento para retiradas, dependendo do método de retirada e dos valores envolvidos. As taxas aplicáveis serão informadas a você antes de concluir a transação de retirada.</p><p><br></p><p>3.2.5. O tempo necessário para processar uma retirada pode variar dependendo do método de retirada escolhido. Em geral, tentaremos processar todas as retiradas o mais rápido possível.</p><p><br></p><p>4. Uso Responsável</p><p><br></p><p>4.1. Jogar deve ser uma forma de entretenimento e não uma maneira de ganhar dinheiro. Você deve se certificar de que você está jogando de maneira responsável e não gastando mais do que você pode perder.</p><p><br></p><p>4.2. Se você acha que pode ter um problema com o jogo, há ferramentas e recursos disponíveis para ajudar. Recomendamos que você utilize as opções de autoexclusão e limites de depósito disponíveis no Website.</p><p><br></p><p>4.3. Se você deseja se autoexcluir, entre em contato com nosso suporte ao cliente para obter assistência na configuração da autoexclusão.</p><p><br></p><p>5. Encerramento e Suspensão de Conta</p><p><br></p><p>5.1. A AGLOW777 N.V. reserva-se o direito de suspender ou encerrar sua Conta a qualquer momento, a seu exclusivo critério, e sem aviso prévio, se acreditarmos que você violou estes Termos ou se tivermos qualquer outra razão para acreditar que você pode ter se envolvido em atividade fraudulenta, ilegal ou não autorizada.</p><p><br></p><p>5.2. Se sua Conta for encerrada ou suspensa, qualquer saldo remanescente em sua Conta pode ser devolvido a você, menos quaisquer taxas ou encargos aplicáveis, e qualquer saldo remanescente poderá ser perdido a critério da AGLOW777 N.V.</p><p><br></p><p>6.15. O valor máximo diário de ganhos para um Cliente não pode exceder 100.000 Euros ou o equivalente na moeda da sua Conta. O “dia” significa o período entre 00:00 GMT e 23:59 GMT.</p><p><br></p><p>7. Fechamento da Conta</p><p><br></p><p>7.1. Você pode fechar sua Conta a qualquer momento e solicitar a retirada do saldo da Conta, sujeito à dedução das taxas de retirada relevantes. Para fechar sua Conta, você deve primeiro cancelar quaisquer apostas em aberto, se aplicável, e entrar em contato com o suporte ao cliente do Website. O fechamento efetivo da Conta corresponderá à rescisão da SLOTAGLOW777 N.V.. Se o motivo do fechamento da Conta estiver relacionado a preocupações sobre possível adição ao jogo, você deve informar a SLOTAGLOW777 N.V..</p><p><br></p><p>7.2. O método de reembolso será a nosso critério absoluto.</p><p><br></p><p>7.3. A AGLOW777 N.V. reserva-se o direito de fechar sua Conta e reembolsar o saldo “Disponível para retirada”, sujeito à dedução das taxas de retirada relevantes, a critério absoluto da SLOTAGLOW777 N.V. e sem qualquer obrigação de fornecer um motivo ou aviso prévio.</p><p><br></p><p>7.4. A AGLOW777 N.V. reserva-se o direito de cancelar e remover qualquer valor de bônus concedido a você se não for utilizado dentro de 1 mês a partir da data em que foi concedido.</p><p><br></p><p>7.5. A AGLOW777 N.V. reserva-se o direito de recusar uma reivindicação de retirada em caso de fraude, momento em que uma Conta será suspensa e o pagamento não será processado.</p><p><br></p><p>7.6. A AGLOW777 N.V. revisará todas as Contas de jogadores e as classificará a seu critério. Uma vez que um jogador seja classificado como “caçador de bônus” ou “abusador de bônus”, todos os ganhos e bônus serão anulados e a Conta será suspensa e o pagamento não será processado.</p><p><br></p><p>8. Informações Pessoais</p><p><br></p><p>8.1. Cumpriremos as leis de proteção de dados aplicáveis em relação às informações pessoais que você nos fornecer. Suas informações pessoais são processadas de acordo com nossa Política de Privacidade, cuja cópia está disponível clicando aqui.</p><p><br></p><p>9. Jogos Interrompidos e Abortados</p><p><br></p><p>9.1. Atividade Criminosa: Caso seja notada qualquer irregularidade (incluindo suspeita de tentativa de lavagem de dinheiro ou fraude), a AGLOW777 N.V. reserva-se o direito de fechar Contas e/ou relatar atividades criminosas ou suspeitas às autoridades regulatórias ou de aplicação da lei relevantes. Todos os saldos das Contas dos infratores serão bloqueados, retiradas serão anuladas e depósitos e ganhos serão perdidos.</p><p><br></p><p>9.2. Colusão e trapaça: A AGLOW777 N.V. tem o direito de desativar Contas de usuários e confiscar os saldos das Contas (incluindo depósitos e ganhos) se detectar tentativa de obter vantagem por meio da troca de informações sobre suas cartas ou estabelecer um acordo colusivo com outros usuários para obter uma vantagem injusta. Essas vantagens podem consistir em despejo de fichas e transferências, discussão de uma mão durante o jogo, uso múltiplo de uma única Conta, jogo suave. A AGLOW777 N.V. realiza uma rigorosa análise do jogo por meios manuais e automatizados e investiga todas as reclamações relacionadas de usuários. Além disso, a AGLOW777 N.V. realiza análises proativas e aleatórias de jogadas e Contas.</p><p><br></p><p>9.3. Atividade Fraudulenta: Quando a AGLOW777 N.V. detectar atividade fraudulenta, ilegal, desonesta ou imprópria (incluindo o uso de VPN, proxy ou serviço semelhante que mascara ou manipula a identificação de sua localização real, ou fazer apostas, apostas ou jogo de poker por meio de um terceiro ou em nome de um terceiro) no Website, temos o direito de bloquear a Conta do usuário e confiscar todos os saldos da Conta sem notificação prévia. Nesses casos, a SLOTAGLOW777 N.V. reserva-se o direito de relatar a atividade fraudulenta às autoridades regulatórias e de aplicação da lei, incluindo, mas não se limitando a, bancos, empresas de cartões de crédito e/ou qualquer pessoa ou entidade que tenha o direito legal a tais informações, e/ou tomar medidas legais contra o usuário.</p><p><br></p><p>10. Chat ao Vivo</p><p><br></p><p>10.1. Como parte do uso do Website, a AGLOW777 N.V. pode fornecer a você uma funcionalidade de chat, que é moderada por nós e sujeita a controles. Reservamo-nos o direito de revisar o chat e manter um registro de todas as declarações feitas nessa funcionalidade. Seu uso da funcionalidade de chat deve ser para fins recreativos e de socialização, e está sujeito às seguintes regras.</p><p><br></p><p>10.2. Você não deve fazer declarações sexualmente explícitas ou extremamente ofensivas, incluindo expressões de preconceito, racismo, ódio ou profanidade.</p><p><br></p><p>10.3. Você não deve fazer declarações abusivas, difamatórias ou que assediam ou insultam o Website ou a AGLOW777 N.V..</p><p><br></p><p>10.4. Você não deve fazer declarações que anunciem, promovam ou se relacionem com outras entidades online.</p><p><br></p><p>10.5. Você não deve fazer declarações sobre a AGLOW777 N.V., o Website ou quaisquer outros sites da Internet conectados à AGLOW777 N.V. que sejam falsas e/ou maliciosas e/ou prejudiciais à AGLOW777 N.V..</p><p><br></p><p>10.6. Você não deve fazer colusão através dos chats ou chats separados. Qualquer chat suspeito será relatado à autoridade regulatória ou de aplicação da lei relevante.</p><p><br></p><p>10.7. No caso de você violar qualquer uma das disposições acima relacionadas à funcionalidade de chat, a AGLOW777 N.V. terá o direito de remover o chat room ou encerrar imediatamente sua Conta. Após tal rescisão, a AGLOW777 N.V. reembolsará quaisquer fundos que possam estar em sua Conta, além de qualquer valor que possa ser devido a nós naquele momento (se houver).</p><p><br></p><p>11. Jogos Interrompidos e Abortados</p><p><br></p><p>11.1. A AGLOW777 N.V. não é responsável por qualquer inatividade, interrupções do servidor, atraso ou qualquer perturbação técnica ou política ao jogo. Reembolsos podem ser concedidos apenas a critério da AGLOW777 N.V..</p><p><br></p><p>11.2. A SLOTAGLOW777 N.V. não aceita qualquer responsabilidade por danos ou perdas que sejam considerados ou alegados como resultantes de ou em conexão com o Website ou seu conteúdo, incluindo, sem limitação, atrasos ou interrupções na operação ou transmissão, perda ou corrupção de dados, falha na comunicação ou linhas, uso indevido do Website ou seu conteúdo por qualquer pessoa ou erros ou omissões no conteúdo.</p><p><br></p><p>11.3. No caso de um mau funcionamento do sistema do cassino, todas as apostas são nulas.</p><p><br></p><p>11.4. No caso de um Jogo ser iniciado mas abortado devido a uma falha no sistema, a SLOTAGLOW777 N.V. reembolsará o valor apostado no Jogo, creditando-o em sua Conta ou, se a Conta não existir mais, pagando-o de uma forma aprovada; e se você tiver um crédito acumulado no momento em que o Jogo foi abortado, creditará em sua Conta o valor monetário do crédito ou, se a Conta não existir mais, pagará a você de uma forma aprovada.</p><p><br></p><p>12. Deveres</p><p><br></p><p>12.1. A AGLOW777 N.V. reserva-se o direito de ceder ou transferir legalmente seus direitos e obrigações sob os Termos. Você não deve ceder ou transferir seus direitos e obrigações sob estes Termos.</p><p><br></p><p>13. Reclamações</p><p><br></p><p>13.1. Se você tiver uma reclamação, pode enviar um e-mail para o suporte ao cliente do Website em AGLOW777@gmail.com.</p><p><br></p><p>13.2. A AGLOW777 N.V. usará seus melhores esforços para resolver a questão relatada prontamente.</p><p><br></p><p>13.3. Se você tiver uma dúvida sobre qualquer transação, pode entrar em contato com a AGLOW777 N.V. em AGLOW777 @gmail.com com detalhes da dúvida. Revisaremos qualquer transação questionada ou disputada. Nosso julgamento é final.</p><p><br></p><p>14. Acordo e Admissibilidade</p><p><br></p><p>14.1. Estes Termos, a Política de Privacidade, a Política de Cookies e qualquer documento a eles expressamente mencionado e quaisquer diretrizes ou regras postadas no Website constituem o acordo e entendimento completo entre você e a AGLOW777 N.V. com respeito a este Website e, salvo em caso de fraude, substituem todas as comunicações e propostas anteriores ou contemporâneas, sejam eletrônicas, orais ou escritas, entre você e a AGLOW777 N.V. com respeito a este Website.</p><p><br></p><p>14.2. Uma versão impressa destes Termos e de qualquer aviso dado em forma eletrônica será admissível em procedimentos judiciais ou administrativos baseados ou relacionados a estes Termos com o mesmo efeito e sujeita às mesmas condições que outros documentos e registros comerciais gerados e mantidos originalmente em forma impressa.</p><p><br></p><p>14.3. Você deve fornecer um endereço válido de e-mail e outras informações de contato ao criar uma Conta. Você deve manter essas informações atualizadas.</p><p><br></p><p>15. Alterações e Atualizações</p><p><br></p><p>15.1. A AGLOW777 N.V. reserva-se o direito de alterar ou atualizar estes Termos a qualquer momento e sem aviso prévio. As alterações entram em vigor no momento da publicação no Website.</p><p><br></p><p>15.2. Você é responsável por revisar regularmente os Termos para estar ciente de quaisquer alterações. Seu uso contínuo do Website após a publicação das alterações será considerado uma aceitação dessas alterações.</p><p><br></p><p>16. Limitação de Responsabilidade</p><p><br></p><p>16.1. A AGLOW777 N.V. não será responsável por quaisquer danos indiretos, consequenciais ou especiais, ou por quaisquer perdas de lucros, dados ou oportunidades de negócios, mesmo que tenhamos sido avisados da possibilidade de tais danos.</p><p><br></p><p>16.2. Nenhuma disposição destes Termos exclui ou limita nossa responsabilidade por morte ou lesão pessoal resultante de negligência ou qualquer outra responsabilidade que não possa ser excluída ou limitada por lei.</p><p><br></p><p>17. Disposições Específicas de Apostas</p><p><br></p><p>17.1. As apostas são aceitas e os resultados são calculados de acordo com as regras especificadas para cada mercado específico. A AGLOW777 N.V. reserva-se o direito de modificar essas regras e de cancelar apostas em mercados onde as regras especificadas não possam ser aplicadas corretamente.</p><p><br></p><p>17.2. Se um evento for cancelado, adiado ou suspendido, a AGLOW777 N.V. reserva-se o direito de determinar a política de reembolso apropriada, que pode variar dependendo do tipo de evento e das circunstâncias.</p><p><br></p><p>17.3. A AGLOW777&nbsp; N.V. pode definir regras específicas para cada mercado de apostas, e todas as apostas serão processadas de acordo com essas regras. É sua responsabilidade ler e entender as regras antes de fazer uma aposta.</p><p><br></p><p>17.4. Se houver uma disputa sobre o resultado de um evento, a AGLOW777 N.V. pode considerar o resultado oficial divulgado pelas autoridades competentes ou organizações relevantes. Qualquer alteração no resultado após a decisão oficial não será considerada para fins de apostas.</p><p><br></p><p>17.5. A AGLOW777 N.V. reserva-se o direito de encerrar ou suspender mercados e apostas em caso de erros técnicos, problemas com os resultados ou outras circunstâncias imprevistas.</p><p><br></p><p>17.6. A AGLOW777 N.V. pode, a seu critério, limitar o montante de apostas e ganhos por evento ou mercado para garantir a integridade e a justiça das apostas.</p><p><br></p><p>17.7. Se houver uma modificação nas regras de um evento ou mercado, a AGLOW777 N.V. pode atualizar as regras e notificar os clientes sobre tais alterações.</p><p><br></p><p>17.8. A decisão de um mercado é feita assim que for determinada. A AGLOW777 N.V. reserva-se o direito de definir os resultados dos jogos caso um mercado não seja determinado anteriormente na partida. Esta regra aplica-se à duração normal da partida e se não houver condições especificadas na descrição do mercado no Website.</p><p><br></p><p>17.9. Se houver uma disputa sobre o resultado de um evento, a AGLOW777 N.V. pode considerar o resultado oficial divulgado pelas autoridades competentes, organizações esportivas ou ligas relevantes. Qualquer alteração no resultado após a decisão oficial não será considerada para fins de apostas.</p><p><br></p><p>17.10. Se um evento for cancelado, adiado ou suspendido, todas as apostas poderão ser anuladas ou mantidas, dependendo das regras específicas do evento e das decisões tomadas pela AGLOW777 N.V. De maneira geral, apostas em eventos cancelados serão reembolsadas.</p><p><br></p><p>17.11. A AGLOW777 N.V. pode, a seu critério, ajustar os mercados de apostas e reembolsar ou manter apostas conforme as regras e circunstâncias do evento.</p>', 'olaaa', '#D5B722', '#D5B722', '#D3AD06', '#D8C53F', '#ffffff', '#ffffff', '#D3AD06', '#ffffff', '#D3AD06', '#ffffff', '#', '#ffffff', '#D3AD06', '#ffffff', '#D3AD06', '#ffffff', '#D3AD06', '#', '#', 20.00, 20.00, 20.00, 20.00, 20.00, 20.00, '#ffffff', '#D3AD06', '#D3AD06', '#ffffff', '#D3AD06', '#D3AD06', 0.50, '#D5B722', '#D8C53F', '0.5', '0.5', '0.5');
