(1, '\'Roboto Condensed\', sans-serif', '#f7f7f7', '#ffffff', '#ffffff', '#ffffff', '#ffffff', '#D8C53F', '#D8C53F', '#D8C53F', '#', '#', '#D8C53F', '#D8C53F', '#D5B722', '#D5B722', '#D5B722', '#D5B722', '#D5B722', '#D5B722', '1.3125rem', '2024-01-01 17:36:03', '2025-08-05 17:11:41', '', '', '', '', '', '', '#DBCE6E', '#D3AD06', '#D5B722', '#D5B722', '#DBCE6E', '#D5B722', '#3E95FE', '#F45C4E', '#ca50f3', '#fbaf01', '/profile/linkconvite', '/profile/promocoes', '/profile/messages', '/profile/promocoes?tab=vip', '', '#D8C53F', '#ffffff', '#D3AD06', '#ffffff', '#F3F2F5', '<p>1. Introduction</p><p><br></p><p>1.1. Ao usar, visitar e/ou acessar qualquer parte da AGLOW e/ou qualquer subdomínio, site ou aplicativo móvel que possuímos ou operamos (o “Website”) e/ou registrar uma conta no Website, você concorda em estar vinculado a estes Termos e Condições, nossa Política de Privacidade, nossa Política de Cookies e quaisquer outras regras aplicáveis aos nossos produtos de apostas ou jogos disponíveis no Website (juntos, os \"Termos\"), e é considerado como tendo aceitado e entendido todos os Termos.</p><p><br></p><p>1.2. Você deve ler os Termos com atenção. Se não concordar com eles e/ou não puder aceitá-los, não use, visite ou acesse o Website.</p><p><br></p><p>1.3. Estes Termos podem ser alterados por nós de tempos em tempos por qualquer motivo (incluindo conformidade com a legislação aplicável ou requisitos dos reguladores). A versão atual dos Termos estará disponível no Website. Se você continuar a usar o Website após essas alterações entrarem em vigor, você será considerado como tendo aceitado tais alterações aos Termos.</p><p><br></p><p>1.4. A AGLOW é operado pela AGLOW777 N.V., uma empresa registrada sob as leis de Curaçau sob o número de registro 137692.</p><p><br></p><p>1.5. A referência a “você”, “seu”, “cliente”, “usuário” ou “jogador” significa qualquer pessoa que use o Website ou quaisquer serviços disponíveis nele e/ou qualquer cliente registrado do Website.</p><p><br></p><p>1.6. A referência a “jogos” significa Cassino, Cassino ao Vivo, Apostas Esportivas, cartas e outros jogos que possam, de tempos em tempos, tornar-se disponíveis no Website. A AGLOW777 N.V. reserva-se o direito de adicionar e remover Jogos do Website a seu critério.</p><p><br></p><p>2. Sua Conta</p><p><br></p><p>2.1. Requisitos legais</p><p><br></p><p>2.1.1. A referência à “Conta” significa uma conta registrada por você no Website após aceitar e concordar com estes Termos. Ao registrar uma Conta, você declara que tem mais de 18 anos de idade ou a maioridade legal mínima mais alta conforme estipulado na jurisdição de sua residência sob as leis aplicáveis a você. É sua responsabilidade saber se os serviços disponíveis no Website são legais no país de sua residência. Pessoas com menos de 18 anos não estão autorizadas a usar o Website e/ou quaisquer serviços disponíveis nele.</p><p><br></p><p>2.1.2. Você não está autorizado a registrar no Website e usar nossos serviços se for residente de Aruba, Austrália, Bonaire, Curaçau, França, Irã, Iraque, Países Baixos, Saba, Espanha, St Maarten, Statia, EUA ou dependências dos EUA, Reino Unido. Reservamo-nos o direito de recusar clientes de quaisquer outros países além das jurisdições acima mencionadas a nosso critério.</p><p><br></p><p>2.2. Registro de Conta</p><p><br></p><p>2.2.1. Para fazer apostas, jogar jogos e depositar dinheiro, você precisa registrar a Conta no Website.</p><p><br></p><p>2.2.2. Para registrar a Conta, você deve fornecer informações completas e atualizadas, incluindo um número de telefone móvel, endereço de e-mail, nome de usuário, senha e outras informações obrigatórias solicitadas no formulário de registro.</p><p><br></p><p>2.2.3. Ao registrar a Conta no Website, você concorda em especificar seu nome legal. Podemos tomar medidas para verificar a precisão das informações que você fornece. Você não está autorizado a alterar esses dados, mas há casos em que você pode solicitar individualmente a alteração de dados entrando em contato com o suporte ao cliente do Website, como em caso de erro honesto, etc.</p><p><br></p><p>2.2.4. Se você escolher, ou se for fornecido com um nome de usuário, senha ou qualquer outra informação como parte de nossos procedimentos de segurança, você deve tratar essas informações como confidenciais e não deve divulgá-las a terceiros. Não somos responsáveis por qualquer abuso ou uso indevido de sua Conta por terceiros devido à sua divulgação, seja intencional ou acidental, ativa ou passiva, dos detalhes de login a terceiros. Nunca solicitaremos que você revele sua senha e nunca iniciaremos contato com você para pedir os memorizadores associados à sua senha.</p><p><br></p><p>2.2.5. Funcionários, ex-funcionários de prestadores de serviços e/ou pessoas afiliadas não estão autorizados a registrar contas no Website e não podem explorar os serviços e promoções disponíveis nele. As mesmas regras se aplicam aos membros da família dos acima mencionados. A violação desta regra resultará no fechamento permanente da conta e as contas referidas serão consideradas fraudulentas. Qualquer ganho derivado de tais atividades será considerado como perdido pelo titular da conta e apenas o valor depositado será devolvido ao titular da conta.</p><p><br></p><p>2.2.6. Você não pode transferir, vender ou penhorar Sua Conta para outra pessoa. Esta proibição inclui a transferência de quaisquer ativos de valor de qualquer tipo, incluindo, mas não se limitando a, propriedade de contas, ganhos, depósitos, apostas, direitos e/ou reivindicações relacionadas a esses ativos, legais, comerciais ou de qualquer outra forma. A proibição de tais transferências também inclui, mas não se limita a, ônus, penhor, cessão, usufruto, comercialização, corretagem, hipoteca e/ou doação em cooperação com um fiduciário ou qualquer outro terceiro, empresa, pessoa natural ou jurídica, fundação e/ou associação de qualquer forma.</p><p><br></p><p>2.3. Problemas com a Conta</p><p><br></p><p>2.3.1. Se você esquecer sua senha ou achar que alguém conhece detalhes de seus dados pessoais, além de suspeitar que outro usuário está se beneficiando injustamente por meio de trapaça ou conluio, você deve relatar a suspeita para nós.</p><p><br></p><p>2.3.2. Reservamo-nos o direito de declarar qualquer aposta ou transação nula total ou parcialmente se, a nosso critério, considerarmos óbvio que qualquer uma das seguintes circunstâncias tenha ocorrido:</p><p><br></p><p>o titular da Conta ou pessoas associadas ao titular da Conta podem influenciar direta ou indiretamente o resultado de um evento;</p><p><br></p><p>o titular da Conta e/ou pessoas associadas ao titular da Conta estão direta ou indiretamente evitando as regras do Website;</p><p><br></p><p>o resultado de um evento ou a aposta foi direta ou indiretamente afetado por atividade criminosa;</p><p><br></p><p>as odds de um evento foram significativamente alteradas devido a um anúncio público relacionado ao evento;</p><p><br></p><p>apostas foram feitas que não teriam sido aceitas de outra forma, mas foram aceitas durante períodos em que o Website foi afetado por problemas técnicos;</p><p><br></p><p>devido a um erro, como um engano, erro de impressão, erro técnico, erro humano, força maior ou outro, apostas foram oferecidas, feitas e/ou aceitas devido a esse erro.</p><p><br></p><p>2.3.3. Quando fecharmos ou suspendermos uma Conta por qualquer motivo, reservamo-nos o direito de fechar quaisquer futuras Contas que possam ser registradas pela mesma pessoa, dispositivo, endereço ou que possam usar as mesmas carteiras de pagamento ou cartões de crédito e anular/cancelar todas as apostas e transações dessas Contas.</p><p><br></p><p>2.3.4. Oferecemos autenticação de dois fatores (2FA) como proteção adicional contra o uso não autorizado de sua Conta. Você é responsável por manter suas informações de login confidenciais e garantir que não possam ser acessadas por outra pessoa.</p><p><br></p><p>2.4. Ao registrar a Conta n